import React from 'react'
import './Button.scss'
import { ReactComponent as ButtonBG } from '../../assets/png/button_bg.png'

export const Button = (props) => {
  return (
    <div className='button'>
      <ButtonBG/>
      <p>{props.title}</p>
    </div>
  )
}

Button.defaultProps={
  title:"none",
}
